import "./styles.css";
import React from 'react';
import { Loader } from '@googlemaps/js-api-loader';


class App extends React.Component {
    render() {
        return <div className="App">
            <div id="mapContainer"><Map /></div>
            <Search />
        </div>;
    }
}

class Map extends React.Component {
    constructor(props) {
        super(props);
    }

    loader = new Loader({
        apiKey: "AIzaSyD8Vp_eqij2KVTiHCTi9mQgKaGCAZ5FRDQ",
        version: "weekly",
        libraries: ["places"]
    });

    mapOptions = {
        center: {
            lat: -25.344, lng: 131.031
        },
        disableDefaultUI: true,
        draggable: true,
        mapTypeId: 'terrain',
        zoom: 4
    };

    render() {
        return (<div id="map"></div>);
    }


    componentDidMount() {
        this.loader
            .load()
            .then((google) => {
                new google.maps.Map(document.getElementById("map"), this.mapOptions);
            })
            .catch(e => {
                // do something
            });
    }
}

class Search extends React.Component {
    constructor(props) {
        super(props);
    }

    render() {
        return <div className="searchContainer">
            <SearchBar />
            <SearchResults />
        </div>;
    }
}

class SearchBar extends React.Component {
    constructor(props) {
        super(props);
    }

    render() {
        return <div className="searchBar">
            <input className="search" placeholder="Search Location..." />
        </div>;
    }
}

class SearchResults extends React.Component {
    constructor(props) {
        super(props);
    }

    renderResults() {
        return <div>Hello</div>;
    }

    render() {
        return <div className="searchResults">
            {this.renderResults()}
        </div>;
    }
}

export default App;
